import Link from "next/link";
import styles from "../components/styles/navbar.module.css";

const NavBar = () => {
  return (
    <ul className={styles.navbar}>
      <li>
        <Link href="/">
          <a>ნაკრები</a>
        </Link>
      </li>
      <li>
        {" "}
        <Link href="/about">
          <a>ფეხბურთის ფედერაცია</a>
        </Link>
      </li>
      <li>
        {" "}
        <Link href="/about">
          <a> CRYSTALBET ეროვნული ლიგა</a>
        </Link>
      </li>
      <li>
        {" "}
        <Link href="/about">
          <a>ფეხბურთის ფედერაცია </a>
        </Link>
      </li>
      <li>
        {" "}
        <Link href="/about">
          <a>საქართველოს თასი</a>
        </Link>
      </li>
    </ul>
  );
};

export default NavBar;
